function PortfolioItem ({ project }) {
    return (
        <div className="col-md-4">
           <div className="portfolio-card m-4 p-3">
           <h3>{project.Title}</h3>
           <p>{project.description}</p>
           </div>
        </div>
    )
}

export default PortfolioItem
